    this.frame_.style.top = rect.top - BORDER_WIDTH + util.dom.scrollTop(document.body) / zoom + "px";
    this.frame_.style.left = rect.left - BORDER_WIDTH + util.dom.scrollLeft(document.body) / zoom + "px";
