    if (startNode.length != null) {
      startNodeLength = startNode.length;
    } else {
      startNodeLength = startNode.childNodes.length;
    }
    if (endNode.length != null) {
      endNodeLength = endNode.length;
    } else {
      endNodeLength = endNode.childNodes.length;
    }
